import React, {Component} from  'react';

import Slider from './Slider';
import Sidebar from './Sidebar';


class Blog extends Component{

	render(){
		return(
			<div id="blog">
				<Slider
				title = "Blog"
				size = "slider-small"
				/>

				<div className="center">
					<div id="content">


						<h1 className="subheader">Listado de articulos</h1>


					</div>

					<Sidebar/>
				</div>
			</div>
		);
	}
}


export default Blog;
